from math import log10

class Solution:
    def numberOfArrays(self, s: str, k: int) -> int:
        n = len(s)
        dp = [0] * n
        d = log10(k)

        for i in range(n):
            j = 1
            v = int(s[i])
            while i - j >= 0 and v <= k and d > j - 1:
                if s[i - j + 1] != "0":
                    dp[i] += dp[i - j]
                v += int(s[i - j]) * 10 ** j
                j += 1
            if i - j == -1 and v <= k:
                dp[i] += 1
        return dp[-1] % (10 ** 9 + 7)


print(Solution().numberOfArrays("1317", 2000))
print(Solution().numberOfArrays("1000", 10000))
print(Solution().numberOfArrays("1000", 10))
print(Solution().numberOfArrays("1234567890", 90))
print(Solution().numberOfArrays("420513611027", 20))
print(Solution().numberOfArrays("", 1000000000))